import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';
// import css
import '/styles/index.css';
import '/css/nav.css';
import '/css/materialize.min.css';

class App extends Component {
  render() {
    return (


      <div className="App">
      //   <h1>Hello World!</h1>
      <nav class="transparent z-depth-0">
        <div class="nav-wrapper">
          <a href="." class="brand-logo" id="icon-link">
            <img id="icon" src="/images/logo/white-small-v2.png"></img>
          </a>
          <a href="#" data-target="mobile-demo" class="sidenav-trigger">
            <i class="material-icons">menu</i>
          </a>
          <ul class="right hide-on-med-and-down" id="topnav">
            <li><a href="/pictures/">Pictures</a></li>
            <li><a href="/paintings/">Paintings</a></li>
            <li><a href="/graphics/">Graphics</a></li>
            <li><a href="https://github.com/gavindaniel" target="_blank">GitHub</a></li>
            <li><a href="https://www.linkedin.com/in/gavin-daniel/" target="_blank">LinkedIn</a></li>
            <li><a href="/shop/">Shop</a></li>
          </ul>
        </div>
      </nav>
      </div>

      // <div className="App">
      //   <div className="App-header">
      //     <img src={logo} className="App-logo" alt="logo" />
      //     <h2>Welcome to React</h2>
      //   </div>
      //   <p className="App-intro">
      //     To get started, edit <code>src/App.js</code> and save to reload.
      //   </p>
      // </div>
    );
  }
}

export default App;
